declare module 'fs-extra' {
  import * as fs from 'fs';
  import * as path from 'path';

  export function createWriteStream(path: string | number, options?: any): fs.WriteStream;
  export function existsSync(path: string | number): boolean;
  export function outputFileSync(path: string | number, data: any, options?: any): void;
  export function pathExists(path: string | number): boolean;
  export function pathExistsSync(path: string | number): boolean;
  export function promises(): Promise<void>;
  export function readFileSync(path: string | number, encoding?: string): string;
  export function remove(path: string | number): Promise<void>;
  export function statSync(path: string | number): fs.Stats;
  export function writeFileSync(path: string | number, data: any, encoding?: string): void;

  export const createWriteStream: typeof fs.createWriteStream;
  export const existsSync: typeof fs.existsSync;
  export const outputFileSync: typeof fs.outputFileSync;
  export const pathExists: typeof fs.pathExists;
  export const pathExistsSync: typeof fs.pathExistsSync;
  export const promises: typeof fs.promises;
  export const readFileSync: typeof fs.readFileSync;
  export const remove: typeof fs.remove;
  export const statSync: typeof fs.statSync;
  export const writeFileSync: typeof fs.writeFileSync;
}

declare module 'gray-matter' {
  import * as matter from 'gray-matter';

  export function read(content: string, options?: any): matter.GrayMatterFile<string>;
  export const read: typeof matter.read;

  export const defaultExport: typeof matter.read;
}

declare module 'obug' {
  import * as obug from 'obug';

  export function createDebug(name: string, options?: any): obug.Debug;
  export const createDebug: typeof obug.createDebug;

  export const defaultExport: typeof obug.createDebug;
}

declare module 'picocolors' {
  import * as colors from 'picocolors';

  export const bold: typeof colors.bold;
  export const cyan: typeof colors.cyan;
  export const dim: typeof colors.dim;
  export const green: typeof colors.green;
  export const red: typeof colors.red;
  export const white: typeof colors.white;
  export const yellow: typeof colors.yellow;

  export const defaultExport: typeof colors;
}
